description:
A lite version of http server, currently not support https

for commandline usage, type in terminal:
httpd ?

class Program
{
    static void Main(string[] args)
    {
        //这个可放入Global.asax第一次运行时执行（传入要映射的Type）
        AutoMapperModule.Init(Assembly.GetExecutingAssembly().ExportedTypes);

        MyClass1 m = new MyClass1() { TestProp = "测试" };
        var map = m.MapTo<MyClass2>();//
    }
}
[AutoMap(typeof(MyClass2))]//特性映射
public class MyClass1
{
    public string Name { get; set; }
    public string TestProp { get; set; }
}
public class MyClass2
{
    public string TestProp { get; internal set; }
}

summary:
Haneke resizes images and caches the result on memory and disk. Everything is done in background, allowing for fast, responsive scrolling. Asking Haneke to load, resize, cache and display an appropriately sized image is as simple as:

ImageView.SetImage(url);
Really.
